func NewHuobi(userConfig map[string]interface{}) *Huobi {
   p := NewHuobiCore()
   p.Init(userConfig)
   return &Huobi{
       HuobiCore: p,
       Core:  p,
       exchangeTyped: NewHtxFromCore(&(p.HtxCore)),
   }
}
func NewHuobiFromCore(core *HtxCore) *Htx {
   return &Htx{
       HtxCore: core,
       Core:  core,
       exchangeTyped: NewExchangeTyped(&core.Exchange),
   }
}

